import React, { Component } from "react";


class Menu extends Component {

    state = {
        level: "",
        style: "",
    }

    // const mmaStyle = {
    //     position: 'relative',
    //     left: '408px';
    // }
    render() {
        return (
    <div>
        <br/>
        <div className="row justify-content-around">
            <div className="col-4">
                <button>Beginner</button>
            </div>
            <div className="col-4">
                <button>Boxing</button>
            </div>
        </div>
        <br/>
        <div className="row justify-content-around">
            <div className="col-4">
                <button>Intermediate</button>
            </div>
            <div className="col-4">
                <button>Kickboxing</button>
            </div>
        </div>
        <br/>
        <div className="row justify-content-around">
            <div className="col-4">
                <button>Advanced</button>
            </div>
            <div className="col-4">
                <button style="{position: relative,
             left: 408px}">MMA</button>
            </div>
        </div>
        <br/>
        <div className="row justify-content-md-center"><button>Start</button></div>

    </div>
        );
    };
};


export default Menu;
